import React from 'react'
import blank from '../img/symbols/WHITESPACE.png'
import './PlaneDisplay.css'

export default function PlaneDisplay({activePlane, handleClick}) {
    const planeUrl = activePlane ? activePlane.url : null;
    return (
      <div className="Plane">
          <img key={Date.now()}
              src={planeUrl}
              className="plane-img"
              alt={blank}
              onClick={handleClick}
          />
      </div>
    ); 
}
